        <div style={styles.header}>
          <BackButton />
          <h1 style={styles.title}>ÌÄ¥Ï¶à Ïú†Ìòï ÏÑ†ÌÉù</h1>
        </div>

        <div style={styles.menuContainer}>
          <div style={styles.card} onClick={() => navigate('/quiz/mcq')}>
            <span style={styles.emoji}>üìù</span>
            <div>
              <h2 style={styles.cardTitle}>Í∞ùÍ¥ÄÏãù ÌÄ¥Ï¶à</h2>
              <p style={styles.cardSubtitle}>Ïó¨Îü¨ ÏÑ†ÌÉùÏßÄ Ï§ë Ï†ïÎãµÏùÑ Í≥®ÎùºÎ≥¥ÏÑ∏Ïöî</p>
            </div>
          </div>

          <div style={styles.card} onClick={() => navigate('/quiz/ox')}>
            <span style={styles.emoji}>‚≠ï‚ùå</span>
            <div>
              <h2 style={styles.cardTitle}>OX ÌÄ¥Ï¶à</h2>
              <p style={styles.cardSubtitle}>O ÎòêÎäî XÎ°ú ÌåêÎã®Ìï¥Î≥¥ÏÑ∏Ïöî</p>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

const styles = {
  page: {
    backgroundColor: '#f9f9f9',
    minHeight: '100dvh',
    padding: '24px 16px 72px 16px',
    fontFamily: "'Segoe UI', sans-serif",
  },
  wrapper: {
    maxWidth: '700px',
    margin: '0 auto',
  },
  header: {
    marginBottom: '28px',
    textAlign: 'center',
  },
  title: {
    fontSize: '22px',
    fontWeight: '700',
    margin: '8px 0',
  },
  menuContainer: {
    display: 'flex',
    flexDirection: 'column',
    gap: '16px',
  },
  card: {
    display: 'flex',
    alignItems: 'center',
    backgroundColor: '#fff',
    padding: '22px',
    borderRadius: '16px',
    boxShadow: '0 4px 12px rgba(0,0,0,0.06)',
    cursor: 'pointer',
    transition: 'transform 0.2s ease, box-shadow 0.2s ease',
  },
  emoji: {
    fontSize: '30px',
    marginRight: '16px',
