  cardSubtitle: {
    fontSize: '13px',
    marginTop: '4px',
    color: '#666',
  },
  '@media (max-width: 480px)': {
    title: { fontSize: '18px' },
    card: { padding: '16px', borderRadius: '12px' },
    emoji: { fontSize: '26px', marginRight: '12px' },
    cardTitle: { fontSize: '16px' },
    cardSubtitle: { fontSize: '12px' },
  },
};

export default QuizMenuPage;
